Criminal Mind (Split Scenes)

Giulia Grandi, Claudia Antonelli, Michelle Ferrari, Edelweiss

A criminal mind has fun with some famous fashion models and showgirls. The seduction that goes on in their green room, backstage on the casting couch surpasses anything you'll see in the pages of their popular magazines. These are the dark recesses of the tainted minds of the world's wildest perverts!

